import SearchBar from '../components/SearchBar'
import { useState } from "react";

const ExplorePage = () => {

    let [trending, setTrending] = useState("")

    return (
        <div>
            <h1 className="text-3xl text-center pt-12">Explore Assets</h1>
            
            {/* Today's trending stocks */}
            <h2 className="text-3xl text-center pt-12">Trending today: { trending }</h2>

            <SearchBar />
        </div>
    )

}

export default ExplorePage
